      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT 63 < NULL AND NOT - col1 * - col2 * col1 * - ( + col2 ) * - col1 BETWEEN - 55 * ( col2 ) AND - CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q630.out
    data: |
